import React from 'react'
import { Link } from 'react-router-dom'

export const Main = () => {
  return (
    <div>
        <div className='categorys'>
            <Link className='link'>Accesorios</Link>
            <Link className='link'>Energizantes</Link>
            <Link className='link'>Ropa</Link>
        </div>
    </div>
  )
}
